void print_elapsed(char str[], struct timeval start)
{
	struct timeval now;

	gettimeofday(&now, NULL);
	int diff_s = now.tv_sec - start.tv_sec;
	int diff_u = now.tv_usec - start.tv_usec;
	printf("%s %d elapsed\n", str, (diff_s * 1000 * 1000 + diff_u));
}


